import Carousel from 'react-bootstrap/Carousel';

import Img1 from './Img1.jpg'

function Carousels() {
  return (
    <Carousel>
      <Carousel.Item>
        <img className="img_carousel" src={Img1} alt="First" />
      </Carousel.Item>

      <Carousel.Item>
        <img className="img_carousel" src={Img1} alt="Second"  />
      </Carousel.Item>

      <Carousel.Item>
        <img  className="img_carousel"src={Img1} alt="Third" />
      </Carousel.Item>
      
    </Carousel>
  );
}

export default Carousels;
